import React, { useState } from "react";
import { Grid, TextField, Button } from "@material-ui/core";
import axios from "axios";
import "tachyons";

import SearchBar from "./component/search_bar";
import RecBoards from "./component/rec_boards";
import GetRecommendations from "./component/get_recommendations";

const Explorify = ({ auth }) => {
  const { token } = auth;
  const [rec_values, set_rec_values] = useState([]);
  const [selected_artists_values, set_selected_artists_values] = useState([]);

  return (
    <div className={"App"}>
      <Grid container style={{ padding: 0 }} spacing={0}>
        <Grid item xs={12}>
          <h1 class="measure f3 f2-m f1-l">Hello From Explorify</h1>
        </Grid>
        <SearchBar auth={auth}></SearchBar>
        <Grid item xs={6}>
          <RecBoards onChange={(set_rec_values, set_selected_artists_values)} />
        </Grid>
        <Grid item xs={12}>
          <Button variant={"contained"}>
            <GetRecommendations
              auth={auth}
              selected_artists={selected_artists_values}
              rec_values={rec_values}
            ></GetRecommendations>
            Get Recommendations
          </Button>
        </Grid>
      </Grid>
    </div>
  );
};

export default Explorify;
